window.bookSummaryJSON = "<p>Narrated duet style by Andi Arndt and Jason Clarke, <i>Delayed Satisfaction</i> is a prequel novella that leads into the full-length audiobook <i>Satisfaction Guaranteed</i>! <i>Delayed Satisfaction</i> was originally released in the <i>The Dating Proposal</i> audiobook and is now available on its own for the first time in Audible Escape!</p> <p>I’m not looking for love. I’m definitely not even interested in dating. But when I first see the handsome stranger singing on stage and our eyes lock, it feels like kismet. For seven blissful days, we fall into an intoxicating romance. Until one night when I learn just how forbidden we are....</p>"; 
